import React, { Component } from 'react'

export default class Body extends Component {
    state={
        courseList:[
            {Id:"react" ,feee:20000,trainer:"srinivas",student:"kondal"},
            {Id:"java" ,feee:20000,trainer:"srinivas",student:"rudra"},
            {Id:"python" ,feee:20000,trainer:"srinivas",student:"child"},
            {Id:"adv" ,feee:20000,trainer:"srinivas",student:"amar"}
        ]
    }
    componentDidCatch(){

    }
  render() {
    return (
      <div>
        <table className='table table-hover-dark'>
          <thead>
            <th>
              id
            </th>
            <th>
              feee
            </th>
            <th>
              trainer
            </th>
            <th>
              Student
            </th>
          </thead>
          <tbody>
            {this.state.courseList.map(value=>{
              return (
                <tr>
                  <td>{value.Id}</td>
                  <td>{value.feee}</td>
                  <td>{value.trainer}</td>
                  <td>{value.student}</td>
                </tr>
              )
            })}
          </tbody>
        </table>
      </div>
    )
  }
}
